import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import '../style/DashNav.css';

const DashNav = () => {
  return (
<div className='side-navbar'>
      <div className='logo'>
        BrightPath
      </div>
      <div className='menu'>
        <Link to='/dashboard' className='menu-item active'>
          <p>Dashboard</p>
        </Link>
      </div>
    </div>
  );
};

export default DashNav;
